import { useEffect, useState } from "react";
import { BrowserRouter, Route, Routes } from "react-router-dom";

import LandingPage from "./pages/LandingPage";



function App() {
    return (
        <div className="App">
            <BrowserRouter>
                <Routes>
                    <Route path="/" element={< LandingPage />} />
                </Routes>
            </BrowserRouter>
        </div>
    );
}

export default App;
